settings.customCss:
/* --- 通用气泡样式 --- */
.message-bubble .content {
  position: relative;
  border-radius: 13px;
  padding: 8px 12px;
}

/* --- "我"（用户）发送的气泡样式 --- */
.message-bubble.user .content {
  background-color: #ffffff;

  /* 三层描边效果 */
  box-shadow: 
    0 0 0 0.5px #9BB4D3 inset,        /* 第一层内描边 */
    0 0 0 2px #ffffff,                 /* 第二层白色描边 */
    0 0 0 1px #E6F2FF,                 /* 第三层浅蓝色描边 */
    5px 3px 0 0 #E6F2FF;               /* 右下实体阴影（纯色不模糊） */

  /* 添加小幽灵装饰 */
  position: relative;
  overflow: visible;
}

.message-bubble.user .content::before {
  content: "";
  position: absolute;
  top: -21px;
  left: -13px;
  width: 32px;
  height: 55px;
  background-image: url('https://files.catbox.moe/fgo3sw.png');
  background-size: contain;
  background-repeat: no-repeat;
  z-index: 10;
}

/* --- "对方"（AI）发送的气泡样式 --- */
.message-bubble.ai .content {
  background-color: #E6F2FF;

  /* 三层描边效果 */
  box-shadow: 
    0 0 0 0.5px #9BB4D3 inset,        /* 第一层内描边 */
    0 0 0 2px #ffffff,                 /* 第二层白色描边 */
    0 0 0 1px #E6F2FF,                 /* 第三层浅蓝色描边 */
    -5px 3px 0 0 #E6F2FF;              /* 左下实体阴影（纯色不模糊） */

  /* 添加小幽灵2号装饰 */
  position: relative;
  overflow: visible;
}

.message-bubble.ai .content::before {
  content: "";
  position: absolute;
  top: -20px;
  right: -10px;
  width: 30px;
  height: 55px;
  background-image: url('https://files.catbox.moe/hvbtzw.png');
  background-size: contain;
  background-repeat: no-repeat;
  z-index: 10;
}
